import React from "react";
import Rating from ""

import info_img from "../../assets/img/service_info.png";

const ServiceInfo = () => {
  const service = {
    id: 1,
    title: "d,njkdkjfn",
    description: "ewlfknkle",
    price: 32,
    rating: 5,
  };
  return <div className='container'>
    <img src={info_img} alt="service_img"/>
    <p>{service.title}</p>
    <p>{service.price}</p>
    <Rating>

    </Rating>
  </div>;
};

export default ServiceInfo;
